#####################################################################
# 	X/Y Stepper Settings
#####################################################################

## X Stepper on MOTOR0(B Motor) DRIVER 0
[stepper_x]
step_pin: PF13
dir_pin: !PF12
enable_pin: !PF14
rotation_distance: 40
microsteps: 64
full_steps_per_rotation:200  #set to 400 for 0.9 degree stepper

# veranderen voor sensorless
# endstop_pin: PG6
endstop_pin: tmc2209_stepper_x:virtual_endstop
homing_speed: 80 # had op 200 # was 40 met sensorless... ben beetje zata dat trage...
homing_retract_dist: 0 # was 5

position_min: 0
position_endstop: 350
position_max: 350
homing_positive_dir: true

[tmc2209 stepper_x]
uart_pin: PC4
interpolate: True
run_current: 0.9
# hold_current: 0.7
sense_resistor: 0.110
stealthchop_threshold: 0
#extra deel voor sensorless
diag_pin: ^PG6
driver_SGTHRS: 95

[stepper_y]
## Y Stepper on MOTOR1 (A Motor) DRIVER 1
step_pin: PG0
dir_pin: !PG1 
enable_pin: !PF15
rotation_distance: 40
microsteps: 64
full_steps_per_rotation:200  
# sensorless
# endstop_pin: PG9
endstop_pin: tmc2209_stepper_y:virtual_endstop
homing_speed: 40 # had op 40. maar zo traag met sensorless
homing_retract_dist:0

position_min: 0
position_endstop: 350
position_max: 350
homing_positive_dir: true

[tmc2209 stepper_y]
uart_pin: PD11
interpolate: True
run_current: 0.9
# hold_current: 0.7
sense_resistor: 0.110
stealthchop_threshold: 0
#sensorless
diag_pin: ^PG9
driver_SGTHRS: 105


#####################################################################
# 	Z Stepper Settings
#####################################################################

## Z0 Stepper - Front Left on MOTOR2_1 -- DRIVER 2
[stepper_z]
step_pin: PF11
dir_pin: !PG3
enable_pin: !PG5
rotation_distance: 40
gear_ratio: 80:16
microsteps: 64
## endstop_pin: probe:z_virtual_endstop ## dit is voor de TAP
# onderste nodig voor de sexbolt
#endstop_pin: PG10
#position_endstop: -5
#    G1 X232 Y348 F15000

#Cartographer is nieuwe z endstop
endstop_pin: probe:z_virtual_endstop # use cartographer as virtual endstop
homing_retract_dist: 0 # cartographer needs this to be set to 0




position_max: 300
position_min: -5
homing_speed: 5 # 5 # was 15, maar dat geeft zon TOK
second_homing_speed: 3 
# homing_retract_dist: 3
[tmc2209 stepper_z]
uart_pin: PC6
interpolate: true
run_current: 0.8
# hold_current: 0.8
sense_resistor: 0.110
stealthchop_threshold: 0

##	Z1 Stepper - Rear Left on MOTOR3 -- DRIVER 3
[stepper_z1]
step_pin: PG4
dir_pin: PC1
enable_pin: !PA0 # niet !PA2, dit is  voor de 1.1 octopus pro
rotation_distance: 40
gear_ratio: 80:16
microsteps:64
[tmc2209 stepper_z1]
uart_pin: PC7
interpolate: true
run_current: 0.8
# hold_current: 0.8
sense_resistor: 0.110
stealthchop_threshold: 0


##	Z2 Stepper - Rear Right on MOTOR4 -- DRIVER 4
[stepper_z2]
step_pin: PF9
dir_pin: !PF10
enable_pin: !PG2
rotation_distance: 40
gear_ratio: 80:16
microsteps: 64
[tmc2209 stepper_z2]
uart_pin: PF2
interpolate: true
run_current: 0.8
# hold_current: 0.80
sense_resistor: 0.110
stealthchop_threshold: 0

##	Z3 Stepper - Front Right on MOTOR5 -- DRIVER 5
[stepper_z3]
step_pin: PC13
dir_pin: PF0
enable_pin: !PF1
rotation_distance: 40
gear_ratio: 80:16
microsteps: 64
[tmc2209 stepper_z3]
uart_pin: PE4
interpolate: true
run_current: 0.8
#hold_current: 0.80
sense_resistor: 0.110
stealthchop_threshold: 0


